342%2C23891426%2C23892345%2C23892481%2C23897656%2C23901904%2C23903765%2C23907595%2C23909010%2C23913084%2C23914261%2C23914854%2C23915343%2C23916144%2C23916925%2C23917383%2C23917634%2C23918675%2C23918720%2C24590164%2C45170004\\u0026ns=yt\\u0026plid=AAWo1fQS20ksBA22\"},\"setAwesomeUrl\":{\"baseUrl\":\"https:\/\/www.youtube.com\/set_awesome?ei=L27zXoG_N9PZ1wajiZjIDg\\u0026plid=AAWo1fQS20ksBA22\\u0026video_id=-1Y5RKcz3bI\",\"elapsedMediaTimeSeconds\":49},\"atrUrl\":{\"baseUrl\":\"https:\/\/s.youtube.com\/api\/stats\/atr?docid=-1Y5RKcz3bI\\u0026ei=L27zXoG_N9PZ1wajiZjIDg\\u0026len=62\\u0026ns=yt\\u0026plid=AAWo1fQS20ksBA22\\u0026ver=2\",\"elapsedMediaTimeSeconds\":5}},\"videoDetails\":{\"videoId\":\"-1Y5RKcz3bI\",\"title\":\"Six Foreigners Accused of Drug Trafficking Could Face Death in Bali, Indonesia\",\"lengthSeconds\":\"62\",\"channelId\":\"UCVSNOxehfALut52NbkfRBaA\",\"isOwnerViewing\":false,\"shortDescription\":\"Indonesian custom officers escort foreign suspects arrested on drug smuggling charges in Bali, Indonesia, Wednesday, December 18.\\n A Swiss man, a Thai man, a Singaporean woman, a Chilean man and two Hong Kong men wearing orange detainee uniforms were paraded with their feet and hands tied at a news conference in Denpasar, the capital of Bali province.\\nThe customs spokesman for the Bali and Nusatenggara regional office, Wachid Kurniawan, said the suspects were arrested separately since last month upon arrival at the airport.\\nKurniawan said the Swiss man was arrested November 4 with a total of 30.04 grams of marijuana in his luggage. Two days later, customs officers nabbed the Thai man with 17.76 grams of marijuana concealed in his underwear.\\nHe said the Singaporean woman was captured November 14 after immigration officer found a small plastic bag with 0.35 gram of cocaine inside her passport, while the Chilean man was nabbed two weeks later with 77.26 grams of liquid methamphetamine in his black suitcase.\\nThe Hong Kong man was arrested December 4 with 3.2 kilograms of crystal methamphetamine in his luggage, and his 19-year-old fellow Hong Kong national was captured last week with 4 kilograms of crystal methamphetamine wrapped in four branded pet food packaging in his luggage, Kurniawan said.\\nMore than 150 people are currently on death row, mostly for drug crimes, in Indonesia. About one-third of them are foreigners.\\nWhile death sentences are often reduced to long jail terms, Indonesia has executed foreign nationals in the past, including two Australian masterminds of the Bali Nine heroin gang who were shot in 2015. (AP\/AFP)\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLD-P6qzAU3kLZyni3TpOYOcdgFXyA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCKt7637ZqTKF7KFSJgGiU8MyPTIg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBWUWiSz6decTN8ghDc9UdM3W6B4w\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCAuaBvHVYY2jbFCGkhpRcnESfPbg\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.4857144,\"allowRatings\":true,\"viewCount\":\"44702\",\"author\":\"VOA News\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"playerConfig\":{\"audioConfig\":{\"loudnessDb\":-19.269917,\"perceptualLoudnessDb\":-33.269917,\"enablePerFormatLoudness\":false},\"streamSelectionConfig\":{\"maxBitrate\":\"5160000\"},\"daiConfig\":{\"enableServerStitchedDai\":false},\"mediaCommonConfig\":{\"dynamicRea :\"https:\/\/i9.ytimg.com\/sb\/-1Y5RKcz3bI\/storyboard3_L$L\/$N.jpg?sqp=-oaymwECSEGi85f_AwYI67jp7wU=|48#27#100#10#10#0#default#rs$AOn4CLCI2JnI_6lINbd36SSK4Xy7YJee5A|80#45#63#10#10#1000#M$M#rs$AOn4CLCdoHssC9RqJ8eA4tBtQSRHbMOzCw|160#90#63#5#5#1000#M$M#rs$AOn4CLAUM8Z4Pbe943e3vLBxyN2jqYybpQ\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/-1Y5RKcz3bI\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/-1Y5RKcz3bI\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/-1Y5RKcz3bI?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/-1Y5RKcz3bI?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"Six Foreigners Accused of Drug Trafficking Could Face Death in Bali, Indonesia\"},\"description\":{\"simpleText\":\"Indonesian custom officers escort foreign suspects arrested on drug smuggling charges in Bali, Indonesia, Wednesday, December 18.\\n A Swiss man, a Thai man, a Singaporean woman, a Chilean man and two Hong Kong men wearing orange detainee uniforms were paraded with their feet and hands tied at a news conference in Denpasar, the capital of Bali province.\\nThe customs spokesman for the Bali and Nusatenggara regional office, Wachid Kurniawan, said the suspects were arrested separately since last month upon arrival at the airport.\\nKurniawan said the Swiss man was arrested November 4 with a total of 30.04 grams of marijuana in his luggage. Two days later, customs officers nabbed the Thai man with 17.76 grams of marijuana concealed in his underwear.\\nHe said the Singaporean woman was captured November 14 after immigration officer found a small plastic bag with 0.35 gram of cocaine inside her passport, while the Chilean man was nabbed two weeks later with 77.26 grams of liquid methamphetamine in his black suitcase.\\nThe Hong Kong man was arrested December 4 with 3.2 kilograms of crystal methamphetamine in his luggage, and his 19-year-old fellow Hong Kong national was captured last week with 4 kilograms of crystal methamphetamine wrapped in four branded pet food packaging in his luggage, Kurniawan said.\\nMore than 150 people are currently on death row, mostly for drug crimes, in Indonesia. About one-third of them are foreigners.\\nWhile death sentences are often reduced to long jail terms, Indonesia has executed foreign nationals in the past, including two Australian masterminds of the Bali Nine heroin gang who were shot in 2015. (AP\/AFP)\"},\"lengthSeconds\":\"62\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/VOAvideo\",\"externalChannelId\":\"UCVSNOxehfALut52NbkfRBaA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"P ut52NbkfRBaA","isOwnerViewing":false,"shortDescription":"Indonesian custom officers escort foreign suspects arrested on drug smuggling charges in Bali, Indonesia, Wednesday, December 18.\n A Swiss man, a Thai man, a Singaporean woman, a Chilean man and two Hong Kong men wearing orange detainee uniforms were paraded with their feet and hands tied at a news conference in Denpasar, the capital of Bali province.\nThe customs spokesman for the Bali and Nusatenggara regional office, Wachid Kurniawan, said the suspects were arrested separately since last month upon arrival at the airport.\nKurniawan said the Swiss man was arrested November 4 with a total of 30.04 grams of marijuana in his luggage. Two days later, customs officers nabbed the Thai man with 17.76 grams of marijuana concealed in his underwear.\nHe said the Singaporean woman was captured November 14 after immigration officer found a small plastic bag with 0.35 gram of cocaine inside her passport, while the Chilean man was nabbed two weeks later with 77.26 grams of liquid methamphetamine in his black suitcase.\nThe Hong Kong man was arrested December 4 with 3.2 kilograms of crystal methamphetamine in his luggage, and his 19-year-old fellow Hong Kong national was captured last week with 4 kilograms of crystal methamphetamine wrapped in four branded pet food packaging in his luggage, Kurniawan said.\nMore than 150 people are currently on death row, mostly for drug crimes, in Indonesia. About one-third of them are foreigners.\nWhile death sentences are often reduced to long jail terms, Indonesia has executed foreign nationals in the past, including two Australian masterminds of the Bali Nine heroin gang who were shot in 2015. (AP/AFP)","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/-1Y5RKcz3bI/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLD-P6qzAU3kLZyni3TpOYOcdgFXyA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/-1Y5RKcz3bI/hqdefaul
